window.bookSummaryJSON = "<p>Devon Sanders, a private investigator known for his efficiency and discretion, is determined to unearth the secrets of the paranormal university, Quintessence. As the truth of his own past is revealed, he learns that some secrets are better left in the dark. </p> <p>When a strange sickness spreads through the school, the evidence points to someone Devon never expected. As the university and its students are threatened, it may be time for Quintessence to redesign the rules of the paranormal community. To save the students, Devon must race against time to stop an enemy that is as elusive...as a shadow. </p> <p>Magic is elemental. </p>"; 
